import React from "react";
import PropTypes from 'prop-types';

const Header = ({ title }) => {
    return (
        <header className="">
            <h1>{title}</h1>
        </header>
    )
}

Header.defaultProps = {
    title: 'Task Tracker'
}
Header.propTypes = {
    title: PropTypes.string.isRequired
}

//Css in React
// const HeaderStyle = {
//     color : 'red',
//     backgroundColor:'black'
// }

export default Header;
